import axios from "axios";
import React from "react";
import InputMask from 'react-input-mask';
import { Link } from "react-router-dom";
import { Button, Container, Divider, Form, Icon } from 'semantic-ui-react';
import { ENDERECO_API } from "../util/constantes";

class FormComprador extends React.Component{

	state = {

		id: null,
		versao: null,
		nome: null,
		enderecoComercial: null,
		enderecoResidencial: null,
        comissao: null,
		trabahoHomeOffice: null,
		qtComprasMediasMes: null,
		contratadoEm: null
	}
	salvar = () => {

		let compradorRequest = {

			id: this.state.id,
			versao: this.state.versao,
			nome: this.state.nome,
			enderecoComercial: this.state.enderecoComercial,
			enderecoResidencial: this.state.enderecoResidencial,
            comissao: this.state.comissao,
			trabahoHomeOffice: this.state.trabahoHomeOffice,
			qtComprasMediasMes: this.state.qtComprasMediasMes,
			contratadoEm: this.state.contratadoEm
		}
	
		axios.post(ENDERECO_API + "api/comprador", compradorRequest)
		.then((response) => {
			console.log('Comprador cadastrado com sucesso.')
		})
		.catch((error) => {
			console.log('Erro ao incluir o um Comprador.')
		})
	}

	render(){

        return(
            <div>

                <div style={{marginTop: '3%'}}>

                    <Container textAlign='justified' >

                        <h2> <span style={{color: 'darkgray'}}> Comprador &nbsp;<Icon name='angle double right' size="small" /> </span> Cadastro </h2>

                        <Divider />

						<div style={{marginTop: '4%'}}>

							<Form>

								<Form.Group widths='equal'>

									<Form.Input
										require
										fluid
										label='ID'
										maxLength="100"
										value={this.state.id}
			                           onChange={e => this.setState({id: e.target.value})}
									   placeholder ="Informe seu id"
									/>

									<Form.Input
										fluid
										label='Versão'
										value={this.state.versao}
										onChange={e => this.setState({versao: e.target.value})} 
										placeholder ="Informe a versão"
										/> 
									
									<Form.Input
										fluid
										label='Nome'
                                        width={6}
										value={this.state.nome}
										onChange={e => this.setState({nome: e.target.value})}
										placeholder ="Nome Completo" 
										/> 
		

									<Form.Input
										fluid
										label='Endereço Comercial'
                                        width={6} 
										value={this.state.enderecoComercial}
										onChange={e => this.setState({enderecoComercial: e.target.value})} 
										placeholder ="Endereço Comercial" 
										/> 

                                     </Form.Group>
		                                  <Form.Group>
    
                                          <Form.Input
										fluid
										label='Endereço Residencial'
                                        width={6}
										value={this.state.enderecoResidencial}
										onChange={e => this.setState({enderecoResidencial: e.target.value})}
										placeholder ="Endereço Residencial" 
										/>
                                        
									<Form.Input
										fluid
										label='Comissão'
                                        width={6} 
										value={this.state.comissao}
										onChange={e => this.setState({comissao: e.target.value})} 
										placeholder ="Comissão" 
										/> 

	                                  <Form.Input
										fluid
										label='Trabalho Home Office'
                                        width={6}
										value={this.state.trabalhoHomeOffice}
										onChange={e => this.setState({trabalhoHomeOffice: e.target.value})}
										/> 

									<Form.Input
										fluid
										label='Compras Medias no Mes'
                                        width={6} 
										value={this.state.qtComprasMediasMes}
										onChange={e => this.setState({qtComprasMediasMes: e.target.value})} 
										 
										/> 
	
                                    <Form.Input
                                        fluid
                                        label='Contratado Em:'
                                        width={6}
                                    >
                                        <InputMask 
                                            mask="99/99/9999" 
											value={this.state.contratadoEm}
											onChange={e => this.setState({contratadoEm: e.target.value})} 
                                            maskChar={null}
                                            placeholder="Ex: 20/03/1985"
                                        /> 
                                    </Form.Input>

								</Form.Group>

								<Form.Group widths='equal' style={{marginTop: '4%'}}  className='form--empresa-salvar'>
									
								<Link to={'/list-comprador'}>
									<Button
										type="button"
										inverted
										circular
										icon
										labelPosition='left'
										color='orange'
                                        onClick={this.listar}>
										<Icon name='reply' />
										Voltar
									
									</Button>
									</Link>
									<Container textAlign='right'>
										
										<Button
											inverted
											circular
											icon
											labelPosition='left'
											color='blue'
											floated='right'
											onClick={this.salvar}
										>
											<Icon name='save' />
											Salvar
										</Button>
										
									</Container>

								</Form.Group>

							</Form>
						</div>
                    </Container>
                </div>
			</div>
		)
	}
}

export default FormComprador;
